tables.table_schema:
CREATE TABLE website_traffic_sources (
    source_id INT PRIMARY KEY,
    source_name VARCHAR(255),
    traffic_count INT,
    last_visited TIMESTAMP
);

CREATE TABLE website_traffic_sources (
    traffic_source_id SERIAL PRIMARY KEY,
    traffic_source_name VARCHAR(100) NOT NULL,
    traffic_source_type VARCHAR(50) NOT NULL
);

CREATE TABLE user_demographics (
    user_id SERIAL PRIMARY KEY,
    user_name VARCHAR(100) NOT NULL,
    user_age INT NOT NULL,
    user_gender VARCHAR(10) NOT NULL
);

CREATE TABLE user_traffic_data (
    user_id INT REFERENCES user_demographics(user_id),
    traffic_source_id INT REFERENCES website_traffic_sources(traffic_source_id),
    visit_date DATE NOT NULL,
    pages_visited INT NOT NULL
);

CREATE TABLE user_actions (
    action_id SERIAL PRIMARY KEY,
    user_id INT REFERENCES user_demographics(user_id),
    action_type VARCHAR(50) NOT NULL,
    action_date TIMESTAMP NOT NULL
);

CREATE TABLE website_traffic_sources (
    id INT,
    source_name VARCHAR(255),
    traffic_count INT
);

CREATE TABLE user_demographics (
    user_id INT,
    username VARCHAR(255),
    age INT,
    gender VARCHAR(10)
);

CREATE TABLE page_views (
    page_id INT,
    user_id INT,
    timestamp TIMESTAMP
);

CREATE TABLE referral_sources (
    source_id INT,
    source_name VARCHAR(255),
    referral_count INT
);

CREATE TABLE user_sessions (
    session_id INT,
    user_id INT,
    start_time TIMESTAMP,
    end_time TIMESTAMP
);
